google.maps.event.addDomListener(window, 'load', initialize);



function createLocationOnMap(title, position, content, imageUrl) {            
    var m = new google.maps.Marker({
        map: movieMap,
        animation: google.maps.Animation.DROP,
        title: title,
        position: position,
        html: content,
        icon: image
    });     

    /*var m = new MarkerWithLabel({
           position: position,
           map: movieMap,
           labelContent: "<img width=5 src="+imageUrl+"/>",
           labelAnchor: new google.maps.Point(50, 0),
           labelClass: "map-labels",
           icon: image
            
        });  */     

    info_window = new google.maps.InfoWindow({
        content: 'loading',
        maxWidth: 400
    });

    /*info_window = new InfoBubble({
          
          borderRadius: 4,
          borderWidth: 1,
          borderColor: '#2c2c2c',
          hideCloseButton: false,
          arrowPosition: 30,
          backgroundClassName: 'phoney',
          maxWidth: 400,
          minWidth:300
        });*/

    google.maps.event.addListener(m, 'click', function () {                
        info_window.setContent(this.html);
        info_window.open(movieMap, this);
        movieMap.panTo(this.getPosition());
        setTimeout(moveMap, 10);
    });

    markers.push(m);
}

function createMarkers(json, title) {
   markers = [];

   if (json.length > 0) {
        json.forEach(function (item) {
            if(item.Title==title || title == '') {
            var myCoord = new google.maps.LatLng(item.Latitude, item.Longitude);
            
            //put together summary text for info window    
            var infoText = '<div id=infoText>';
            if(item.Poster.length > 0){
                infoText = "<img class='pull-right thumbnail' src=http://image.tmdb.org/t/p/w92" + item.Poster + ">"; 
            }

            infoText += "<b><h4>" + item.Title + " (" + item.ReleaseYear + ")</h4></b>" 
                +  "<b>" + item.Locations + "</b>"    
                + "<br>Directed by " + item.Director 

            //display cast information
            if(item.Cast.length > 0) {
                infoText += "<br>Starring: " + item.Cast;
            }
            else if(item.Actor1.length > 0) {
                infoText += "<br>Starring: " + item.Actor1;
                if(item.Actor2.length > 0) {
                    infoText += ", " + item.Actor2;
                }
                if(item.Actor3.length > 0) {
                    infoText += ", " + item.Actor3;
                }
            }
            //only for movies with synopsis
            if(item.Overview.length > 0) {
                infoText += "<br>Synopsis: " + item.Overview
            }

            if(item.FunFacts.length > 0) {
                infoText += "<br>Fun Fact: " + item.FunFacts;
            }

            infoText += "<br><br>";

            if(item.IMDB_ID.length > 0) {
                infoText += "<a href=http://www.imdb.com/title/"+item.IMDB_ID+">Get Details</a>";
             }   

            if(item.YouTube.length > 0){
                infoText += " | <a href=https://www.youtube.com/watch?v="+item.YouTube+">View Trailer</a>";
             }

             //add directions link
             infoText += " | <a href=http://maps.google.com/?daddr=" + item.Latitude +","+item.Longitude+">Get Directions</a>";
                
            //add street view link
            infoText += " | <a href=http://maps.googleapis.com/maps/api/streetview?size=400x400&location="+item.Latitude+","+item.Longitude
                        +"&fov=90&heading=235&pitch=10>View Street View</a>"
            
            infoText += "</div>";
            
            createLocationOnMap(item.Title, myCoord, infoText, "http://image.tmdb.org/t/p/w92" + item.Poster);
            }
        });
    }
}

function moveToLocation()
{   
    clearTimeout(tour);
    //move to the users current location
    if (navigator.geolocation) {
     navigator.geolocation.getCurrentPosition(function (position) {
         initialLocation = new google.maps.LatLng(position.coords.latitude, position.coords.longitude);
         movieMap.setCenter(initialLocation);
     });
    }
}

function resetLocation()
{
    clearTimeout(tour);
    //reset location to initial map starting point
    initialLocation = new google.maps.LatLng(37.7833, -122.4167)
    movieMap.setCenter(initialLocation);
}

function resetFilter() {
    //reset the movie filter and recreate markers if selected
    if($("#mySelect").val() != '') {
        $("#mySelect").val('');
        //remove all markers
        for (i = 0; i < markers.length; i++) {
            markers[i].setMap(null);
        }
        createMarkers(json, '');
        movieMap.setZoom(14);
    }
}

function randomMovie()
{
    resetFilter();

    clearTimeout(tour);
    //display marker at random
    var i = Math.floor(Math.random() * markers.length);
    google.maps.event.trigger(markers[i], 'click');
    movieMap.panTo(markers[i].getPosition());
    setTimeout(moveMap, 10);
}

function moveMap() {
    movieMap.panBy(0, -40);
}

function takeATour(pause)
{
    resetFilter();

    if(pause == null) {
        
        //display marker at random every 7 seconds
        var i = Math.floor(Math.random() * markers.length);
        google.maps.event.trigger(markers[i], 'click');
        movieMap.panTo(markers[i].getPosition());
        setTimeout(moveMap, 10);
        tour = setTimeout(takeATour,5000);

        //change menu button to say pause tour
        $("#LinkTour").attr("onclick","takeATour(true);");
        $("#TourText").html(" Pause Tour");
    }
    else {
        //alert('pause');
        clearTimeout(tour);
        //change menu button to say start tour
        $("#LinkTour").attr("onclick","takeATour();");
        $("#TourText").html(" Take a Tour");
    }
}

function populateDropdown(json)
{
    var lastSelection = '';
    json.forEach(function (item) {
        if(item.Title != lastSelection) {
         $("#mySelect").append($('<option>').text(item.Title + " (" + item.ReleaseYear + ")").attr('value', item.Title));
         lastSelection = item.Title;
        }
    });

}

function movieChange(movie) {
    //remove all markers
    removeAllMarkers()
    //readd markers for just that movie
    createMarkers(json, movie.value);

    if(movie.value != '') {
        //move to first marker in array 
        google.maps.event.trigger(markers[0], 'click');
        movieMap.panTo(markers[0].getPosition());
  
        movieMap.setZoom(13);
        setTimeout(moveMap, 10);
    }
    else
    {
        resetLocation();
    }
}

function removeAllMarkers()
{
    for (i = 0; i < markers.length; i++) {
        markers[i].setMap(null);
    }
}



